&gt; Used inÂ context The tracking cookie token value used for HubSpot lead activity tracking. You can retrieve this value from the "HubSpotutk" cookie placed in the user's browser by the HubSpot JavaScript Tracking Code; the tracking code must be installed on the page that contains the form.
&gt; Please Note While the hutk value is not required for the submission to be accepted, this token is used to associate analytics data with a contact record, so without this you will not see any page views or analytics source data for the contact record.
